import React from "react";
import Typical from "react-typical";

const Logo = (props) => {
  return (
    <div className={props.style}>
      <h2>
        Hi! I am Xinyu Tang,
        <p style={{ display: "inline-block" }}>
          <Typical
            loop={Infinity}
            wrapper="b"
            steps={[
              " aspiring web developer",
              2000,
              " aspiring software engineer",
              2000,
            ]}
          />
        </p>
      </h2>
    </div>
  );
};

export default Logo;
